import React from "react"

import "./Startseite.css"
import JapanImg from "./assets/japan.jpg"

function Startseite(){
    return(
        <main className="startseite__body">
            <img src={JapanImg} alt="japan.img"></img>

        </main>
    )
}

export default Startseite
